import {Navbar} from "../components/navbar"

const numbers = [1, 2, 3, 4 ,5]

function Home(){
    return (
        <div className="count">
            {numbers.map(number => (
                <p>{number}</p>
            ))}
        </div>
    );
}

export default Home;
